import React from "react";
import HTML from "../assets/html.png";
import CSS from "../assets/css.png";
import JavaScript from "../assets/javascript.png";
import Node from "../assets/node.png";
import GitHub from "../assets/github.png";
import Mongo from "../assets/mongo.png";
import Logo from '../assets/react.png';
import Tailwind from '../assets/tailwind.png';

const Skills = () => {
  return (
    <div name="skills" className="w-full h-screen bg-[#4f3b78] text-[#f6e5e5] ">
      <div className="max-w-[1000px] mx-auto p-4 flex flex-col justify-center h-full">

          <p className="text-4xl sm:text-5xl inline border-b-4 border-[#c8d679] py-1">
            Skills
          </p>
          <p className="py-4">
            // Technologies that I am most familiar with
          </p>

        {/*Icons Container*/}
        <div className="w-full grid grid-cols-2 sm:grid-cols-4 gap-4 text-center py-8">
          <div className="bg-[#363b4e] shadow-md shadow-[#2b162e] hover:scale-110 duration-500">
            <img className="w-20 mx-auto" src={HTML} alt="HTML icon" />
            <p className="my-4">HTML</p>
          </div>
          <div className="bg-[#363b4e] shadow-md shadow-[#2b162e] hover:scale-110 duration-500">
            <img className="w-20 mx-auto" src={CSS} alt="CSS icon" />
            <p className="my-4">CSS</p>
          </div>
          <div className="bg-[#363b4e] shadow-md shadow-[#2b162e] hover:scale-110 duration-500">
            <img
              className="w-20 mx-auto"
              src={JavaScript}
              alt="JavaScript icon"
            />
            <p className="my-4">JavaScript</p>
          </div>
          <div className="bg-[#363b4e] shadow-md shadow-[#2b162e] hover:scale-110 duration-500">
            <img className="w-20 mx-auto" src={Logo} alt="React icon" />
            <p className="my-4">React</p>
          </div>
          <div className="bg-[#363b4e] shadow-md shadow-[#2b162e] hover:scale-110 duration-500">
            <img className="w-20 mx-auto" src={Node} alt="Node icon" />
            <p className="my-4">Node</p>
          </div>
          <div className="bg-[#363b4e] shadow-md shadow-[#2b162e] hover:scale-110 duration-500">
            <img className="w-20 mx-auto" src={GitHub} alt="GitHub icon" />
            <p className="my-4">GitHub</p>
          </div>
          <div className="bg-[#363b4e] shadow-md shadow-[#2b162e] hover:scale-110 duration-500">
            <img className="w-20 mx-auto" src={Mongo} alt="Mongo icon" />
            <p className="my-4">MongoDB</p>
          </div>

          <div className="bg-[#363b4e] shadow-md shadow-[#2b162e] hover:scale-110 duration-500">
          <img className="w-20 mx-auto" src={Tailwind} alt="Tailwind icon" />
            <p className="my-4">Tailwind</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Skills;
